const logisticRegression = require("./index");

const data = [
  [10, 140],
  [11, 153],
  [12, 162],
  [13, 169],
  [14, 173]
];

test("", () => {
  const values = logisticRegression.model(data);
  expect(values.A).toBe(28.784376756762224);
  expect(values.B).toBe(0.4581611361433602);
  expect(values.C).toBe(181.32566859990467);

  const predict = logisticRegression.predict(data, 0);
  expect(predict).toBe(6.087945706593865);
});
